const AppWithFont = () => {
  return (
    <div style={{ fontFamily: "'Noto Sans', sans-serif" }}>
      <App />
    </div>
  );
};

reactRoot.render(
  <React.StrictMode>
    <AppWithFont />
  </React.StrictMode>
);
